Cell.Data:
Achtung: Formatänderung bei 6007019 ab VZ 2007: neues Format %;
Feldkennung 6007019 (Kz 40.104) 
entfällt zum VZ 2008

Gilt nicht für ElsterFormular im VZ 2000:
In diesem VZ muss bei ElsterFormular die Feldkennung vom Steuerpflichtigen erklärt werden;
ab VZ 2008 muss das Feld explizit durch den Steuerpflichtigen gefüllt werden

Bei ELSTER wurde die Anlagenbezeichnung "Kinder" in der Datenbank für alle VZs beibehalten.

Mögliche Vordruckanzahl:
VZ 1998 und VZ 1999: 1 – 2; 
VZ 2000 und VZ 2001: 1 – 12; 
ab VZ 2002: 1 - 14

lfd. Nr. Vordruck = 00001;
Rückwirkende Vergabe von Kennzahlen;
Summenbildung ab MZI 07 (sieben !)

lfd. Nr. Vordruck = 00002;
Rückwirkende Vergabe von Kennzahlen;
Summenbildung ab MZI 07 (sieben !)

ab VZ 2006:
Eine Anlage GSE je Ehegatte

Anlage GSE wurde im VZ 2008 aufgeteilt in die Anlagen G und S;
MZI auf 99 erhöht;
Achtung: Summenbildung ab MZI 07 (sieben!)
